ForAll( selected_time_entry_update.days, 
    With({
       record_exists: Not(IsBlank(ThisRecord.old)),
       day: ThisRecord.day,
       is_updated: Not(ThisRecord.new = ThisRecord.old),
       date: DateAdd(selected_time_entry_update.week_start_date, ThisRecord.day -1 ),
       newValue: Value( ThisRecord.new )
    },
    //Trace( $"Day: {day} record exists: {record_exists} is updated: {is_updated}" );
    If( is_updated,
        If( record_exists, 
            With({ 
                //recordId: LookUp( selected_time_entry_update.records, 'Date of Interest ' = date ).'AH Timesheet'
                record: LookUp( DropColumns( selected_time_entry_update.records, "week_number"), 'Date of Interest ' = date ) 
            },
            //Patch( 'AH Timesheets', LookUp('AH Timesheets', 'AH Timesheet' = recordId ),  { 'Working Hours': newValue * 60 } ) )));
            Patch( 'AH Timesheets', record,  { 'Working Hours': newValue * 60 } ) ),
            // ELSE
            Patch( 'AH Timesheets',
                        Defaults('AH Timesheets'),
                        {
                            Project: selected_time_entry_update.project,
                            'Date of Interest ': date,
                            'Approval Status': selected_time_entry_update.status,
                            'Week Number': WeekNum( date, StartOfWeek.Monday ),
                            'Timesheet Year': $"TS{var_selectedYear}",
                            Reason: selected_time_entry_update.reason,
                            'Resource Email': User().Email,
                            'Working Hours': newValue * 60
                        }
                    )

        ));
    true
));
